input = """"""


def is_reactive(a, b):
    return (a.isupper() and b.islower() and b.upper() == a) or \
           (a.islower() and b.isupper() and a.upper() == b)


def react(p):
    remaining = """"""

    while True:
        reacted = False
        i = 0
        while i < len(p) - 1:
            if not is_reactive(p[i], p[i + 1]):
                remaining += p[i]
            else:
                reacted = True
                i += 1  # consume p[i+1] also
            i += 1

        if not reacted:
            break
        else:
            p = remaining + p[-1]
            remaining = """"""

    return p


def first():
    return len(react(input))


def second():
    pairs = set()
    for c in input:
        pairs.add(c.lower())

    length = None
    for p in pairs:
        rem = input.replace(p.lower(), "").replace(p.upper(), "")

        r = react(rem)
        if length is None or len(r) < length:
            length = len(r)

    return length


if __name__ == "__main__":
    print("Length of remaining polymer {0}".format(first()))
    print("Shortest chain found {0}".format(second()))
